function [stateGuess,controlGuess] = LISAGuessFunction(timeVector,timeVectorType,phaseObj)

global config scaleUtil

guessData = LISAGuessData()
numTimes = length(timeVector);
stateGuess = zeros(numTimes,7);
for i = 1:numTimes
    nonDimTime = scaleUtil.UnScaleTime(timeVector(i),phaseObj.centralBody,phaseObj.refEpoch);
    stateDim = interp1(guessData(:,1),guessData(:,2:8),nonDimTime,'spline');
    stateGuess(i,:) = transpose(scaleUtil.ScaleState(stateDim',phaseObj.centralBody));
end


for i = 1:numTimes
    if timeVectorType(i) == 1
       controlGuess(i,:) = [.1 1 1 1];
    end
end

x = 7;


end

